import React from "react";
import { Card, Button, CardTitle, Row, Col, Label } from "reactstrap";

import { connect } from "react-redux";
import { bindActionCreators } from "redux";

import * as ApplicationActions from "../../store/actions";

import * as S from "./styles";

const Application = () => {
  React.useEffect(() => {
    alert("hello");
  });

  return (
    <S.Container className="container">
      <Row>
        <Col md="6">
          <S.Label>Name</S.Label>
          <S.UserData>Paulo Cesar</S.UserData>
        </Col>
        <Col md="6">
          <S.Label>Email</S.Label>
          <S.UserData>pcfmello@gmail.com</S.UserData>
        </Col>
      </Row>
      <S.Button color="danger">Logout</S.Button>
    </S.Container>
  );
};

const mapStateToProps = (state) => ({
  user: state.user,
  signedCourses: state.signedCourses,
});

const mapDispatchToProps = (dispatch) =>
  bindActionCreators(ApplicationActions, dispatch);

export default connect(mapStateToProps, null)(Application);
